import { useEffect, useState } from "react";
import { fetchData } from "./Api";

const Listfrech = ({ title, param }) => {
  const [list, setList] = useState([]);
  useEffect(() => {
    fetchData(param).then((res) => setList(res.data.results));
  }, []);
  console.log(list);
  return (
    <section class=" bg-white body-font">
      <div class="container px-5 py-24 mx-auto">
        <div class="flex flex-wrap -m-4">
          {list.map((item) => (
            <div class="lg:w-1/4 md:w-1/2 p-4 w-full">
              <a class="block relative h-48 rounded overflow-hidden">
                <img
                  class="object-cover object-center w-full h-full block"
                  src={`https://image.tmdb.org/t/p/original${item.poster_path}`}
                  alt={item.title}
                />
              </a>
              <div class="mt-4">
                <h3 class="text-white text-xs tracking-widest title-font mb-1">
                 Air: {item.first_air_date}
                </h3>
                <h2 class="text- title-font text-lg font-medium">
                  {item.name}
                </h2>
                <p class="mt-1 text-green-700">Ratings:{item.vote_average}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Listfrech;
